import React, {Component} from 'react';
import {connect} from 'react-redux';

class PresentedQuestions extends Component {
    state = {
        inputtedQuestions: []
    };

    render() {
        const presentedQuestions = this.props.values.map(questionItem => (
            <div>
                <h3>{questionItem.question}</h3>
            </div>
        ));
        return (
            <div>
                <h1>Created questions</h1>
                {presentedQuestions}
            </div>
        );
    }
}

const mapStateToProps = (state) => {
    return {
        values: state.questionReducer
    };
};

export default connect(mapStateToProps, null)(PresentedQuestions);
